import React from 'react'
import '../styles/series.scss'



const Series = () => {


    return (
        <div>
            <div class='titles'>
                <h1 class='titles-series'>Series</h1>
                <h5 class='titles-series'>Proximamente tus series favoritas</h5>
            </div>

            <div class='gif'>
                <img class='gif-series' src='https://c.tenor.com/Fg68Ac7j5IgAAAAC/mj-michael-jackson.gif' />
            </div>
        </div>
    )
}

export default Series;
